def get_all_idcaixa(cursor):
    cursor.execute("SELECT MAX(idcaixa) FROM caixa")
    return cursor.fetchall()


def generate_idcaixa(cursor):
    all_idcaixa = get_all_idcaixa(cursor)
    if len(all_idcaixa) == 0:
        return 1
    else:
        return all_idcaixa[0][0] + 1




